                <div>
                    <div className='t-12 t-med'>
                        more info about hyemi
                        <div className='t-18 t-reg'>Curriculum Vitae</div>
                    </div>
                    <div className='t-12 t-med'>
                        email me
                        <div className='t-18 t-reg'>info@hyemisong.com</div>
                    </div>
                    </div>
                </div>
        )
    }
}
